BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Pupil" (
	"idPupil" INTEGER,
	"namePupil"	TEXT,
	"refAvatar"	INTEGER UNIQUE,
	PRIMARY KEY("idPupil" AUTOINCREMENT),
    CONSTRAINT fk_Pupil_Avatar FOREIGN KEY (refAvatar) REFERENCES Avatar(idAvatar)
);
CREATE TABLE IF NOT EXISTS "Module" (
	"idModule" INTEGER,
	"reference"	TEXT UNIQUE,
	PRIMARY KEY("idModule" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "PupilModuleAccess" (
	"refPupil"	INTEGER,
	"refModule"	INTEGER,
    CONSTRAINT "pupilModuleAccess" UNIQUE("refPupil","refModule"),
    CONSTRAINT fk_PupilModuleAccess_Pupil FOREIGN KEY (refPupil) REFERENCES Pupil(idPupil),
    CONSTRAINT fk_PupilModuleAccess_Module FOREIGN KEY (refModule) REFERENCES Module(idModule)
);
CREATE TABLE IF NOT EXISTS "Avatar" (
	"idAvatar" INTEGER,
	"data"	BLOB UNIQUE,
	"available"	INTEGER DEFAULT 1,
	PRIMARY KEY("idAvatar" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "GridCell" (
	"idGridCell" INTEGER,
	"axisX"	INTEGER,
	"axisY"	INTEGER,
	"refAvatar"	INTEGER UNIQUE,
	PRIMARY KEY("idGridCell"),
    CONSTRAINT fk_GridCell_Avatar FOREIGN KEY (refAvatar) REFERENCES Avatar(idAvatar)
);
CREATE TABLE IF NOT EXISTS "GridCol" (
	"idGridCol"	INTEGER,
	"axisY"	INTEGER UNIQUE,
	"refAvatar"	INTEGER UNIQUE,
	PRIMARY KEY("idGridCol"),
    CONSTRAINT fk_GridCol_Avatar FOREIGN KEY (refAvatar) REFERENCES Avatar(idAvatar)
);
CREATE TABLE IF NOT EXISTS "GridRow" (
	"idGridRow"	INTEGER,
	"axisX"	INTEGER UNIQUE,
	"refAvatar"	INTEGER UNIQUE,
	PRIMARY KEY("idGridRow" AUTOINCREMENT),
    CONSTRAINT fk_GridRow_Avatar FOREIGN KEY (refAvatar) REFERENCES Avatar(idAvatar)
);
COMMIT;
